  display: grid;
  height: 50%;
  gap: 40px;
  grid-template-columns: 375px 375px 375px 375px;
  width: 100%;
  justify-content: center;

`;




const HomeCardList = () => {
  return (
    <ListContainer>
      <Wrapper>



      </Wrapper>

    </ListContainer>
  );
};

export default HomeCardList;
